// Home.js
import React from 'react';
import pic from './assets/cat.jpeg';
import styled from 'styled-components';

const HomeContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: calc(100vh - 78px);
`;

const RoundedImage = styled.img`
  border-radius: 50%;
  width: 150px; /* Adjust the width as needed */
  height: 150px; /* Adjust the height as needed */
  object-fit: cover; /* Ensure the image covers the entire container */
  margin-bottom: 20px; /* Add margin for spacing */
`;

const Home = () => {
  return (
    <HomeContainer>
      <h2>Welcome to My Website</h2>
      <RoundedImage src={pic} alt="Cute Cat" />
      <p>Roxana Halati (like the city Galati but with H)</p>
      <p>Assistant PhD</p>
      <p>UBB FMI</p>
      <p>Email: example@example.com</p>

      <div>
        <p>
          Hi there! Thank you for visiting my website. Lorem Ipsum Dolor Sit Amet, consectetur adipiscing elit. Sed do
          eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation
          ullamco laboris nisi ut aliquip ex ea commodo consequat.
        </p>
      </div>
    </HomeContainer>
  );
};

export default Home;
